import React from 'react'
import bg from "../assets/image/gb-head.jpg"
export default function Header() {
    return (
       <div className="header container-fluid">
      <div className="headerTitles">
      </div>
      <img
        className="headerImg" src={bg} alt="bg" fluid />
    </div>
    )
}
